import Master from '../components/Master';

const outfoxing = new Audio('/outfoxing.mp3');
const faded = new Audio('/faded.mp3');

const Home = () => {
  (<Master audioElement={outfoxing} />), (<Master audioElement={faded} />);
};

export default Home;
